import React from 'react';

import { Card, Image } from 'semantic-ui-react';
import { withRouter } from 'react-router';

const DoctorCard = ({ doctor: {api_id, name, vicinity, rating, getPlaceDetails, photos} }) => {
  return (
    <Card onClick={(e) => getPlaceDetails(e, api_id)}>
      <Card.Content>
        <Card.Header>{name}</Card.Header>
      </Card.Content>
    <Image alt='' src={photos[0]}></Image>
      <Card.Content>
        Address: {vicinity}
        <Card.Meta></Card.Meta>
        <span>Rating: {rating}</span>
      </Card.Content>
    </Card>
  );
};

export default withRouter(DoctorCard);
